import React, { useState } from "react";
import Card from "../../common/card";
import "./"

function Movies(props) {
  const movies = [
    { name: "mai", id: 1 },
    { name: "mm", id: 2 },
    { name: "mm", id: 3 },
    { name: "mm", id: 4 },
    { name: "mm", id: 5 },
    { name: "mm", id: 6 },
    { name: "mm", id: 7 },
    { name: "mm", id: 8 },
  ];

  return (
    <>
      <div className="movies">
        {movies.map((movie) => (
          <Card
            imgSrc="../../../images/movie.jpg"
            movieName={movie.name}
            movieStory={movie.story}
          />
        ))}
      </div>
    </>
  );
}

export default Movies;
